tables.table_schema:
CREATE TABLE palm_vein_recognition_data (
    user_id INT PRIMARY KEY,
    timestamp TIMESTAMPTZ,
    vein_pattern BYTEA,
    access_level INT
);

CREATE TABLE PalmVeinRecognition (
    id SERIAL PRIMARY KEY,
    user_id INT NOT NULL,
    vein_data BYTEA NOT NULL,
    timestamp TIMESTAMP NOT NULL
);

CREATE TABLE SecurityAuditTrail (
    audit_id SERIAL PRIMARY KEY,
    user_id INT NOT NULL,
    activity VARCHAR(255) NOT NULL,
    timestamp TIMESTAMP NOT NULL
);

CREATE TABLE palm_vein_users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    palm_vein_data BYTEA
);

CREATE TABLE access_logs (
    log_id SERIAL PRIMARY KEY,
    user_id INT,
    access_time TIMESTAMP,
    success BOOLEAN
);

CREATE TABLE security_levels (
    level_id SERIAL PRIMARY KEY,
    level_name VARCHAR(50)
);

CREATE TABLE user_roles (
    role_id SERIAL PRIMARY KEY,
    user_id INT,
    role_name VARCHAR(50)
);

CREATE TABLE User (
    user_id INT PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    palm_vein_data BYTEA,
    security_level INT
);

CREATE TABLE SecurityLevel (
    level_id INT PRIMARY KEY,
    level_name VARCHAR(50) NOT NULL
);

CREATE TABLE SystemConfig (
    config_id INT PRIMARY KEY,
    parameter_name VARCHAR(50) NOT NULL,
    parameter_value VARCHAR(100) NOT NULL
);
